div.div:
interface Vehicle {
productID: ID!
modelName: String!
price: Int
}
type Car implements Vehicle {
productID: ID!
modelName: String!
price: Int
doors: Int
}
type Motorcycle implements Vehicle {
productID: ID!
modelName: String!
price: Int
hasSidecar: boolean
}
type Query {
getVehicke(productID: ID!): Vehicle
}
